import React from 'react';
import logo from './logo.svg';
import './App.css';

const bucketListData = [
  {
    title:"Bucket 1",
    bucketId:"123"
  },
  {
    title:"Bucket 2",
    bucketId:"123"
  },
  {
    title:"Bucket 3",
    bucketId:"123",
  }
]

const todoList = (data) => {
  let h = [];
  data.map((item,index)=>{
    h.push(
      <tr key={index}>
        <td><input type="checkbox"/></td>
      <td>{item.taskName}</td>
      <td><button>Delete</button></td>
      <td><button>Edit</button></td>
    </tr>
    )
  })
  return h;
}
const bucketList = () => {
  let h= [];
   bucketListData.map((item,index)=>{
        h.push(<li> {item.title}</li>
        )
      })
      return h; 
}
function App() {
  return (
    <div className="container">
      <h1>BucketLists</h1>
      <input placeholder="Add New Bucket" type="text"/>
      <ul list-unstyled>
      {bucketList()}
      </ul>
    </div>
  );
}

export default App;
